/* 디폴트 체크 초기속성값을 객체로 리턴하는 함수만들어 */

export const fnSetObj = function(n){
  let _chkObj ={}
  for(let i=1; i<=2; i++){
    _chkObj[i] = false 
  }
  _chkObj[n] = true
  return _chkObj
}


export const fnCheckBMI = (gender, m, kg) => {
  const BMI = kg / (m * m) 
}
